  Texas COVID-19 Vaccine Tracker





  The reach of COVID-19 on Texas and the world has been devastating. As our state joins a global effort to put coronavirus into our past, we are tracking the Texas vaccine roll-out as it unfolds in real-time.
  Texas has 22,421,178 people above the age of 16 who are currently eligible for the vaccine. As of Mar 30, 2021, the state has:


   | Fully Vaccinated: 3,972,931 people or 18% of the population 16+  | Vaccinated w/ At Least One Dose: 7,422,893 people or 33% of the population 16+  | Administered: 61,262 doses in one day on Mar 30, 2021 or 0.27% of the population 16+  | A 7-Day Average of 176,405 administered per day or 0.79% of the population 16+



